import React from "react";
import "./Tooltip.css";

function Tooltip({ children, title, showTooltip }) {
  return (
    <div
      className={showTooltip ? `tooltip showTooltip` : "tooltip"}
      data-tool-tip={title}
    >
      {children}
    </div>
  );
}

export default Tooltip;
